def parseCometsFile():
    "This code snippet produced the above dictionary"

    dict = {}

    filename = "ephemerisComets.txt"
    path = "/home/sandboxes/pmargani/dss/trunk/nell/utilities/"
    fullpath = path + filename
    f = open(fullpath, 'r')
    lines = f.readlines()

    for l in lines:
        # skip the comments
        if l[0] != "#":
            parts = l.split(",")
            name = parts[0]
            dict[name] = l

    return dict        
        

